// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title OptiIdRegistry
 * @dev A registry for Opti.ID identifiers
 */
contract OptiIdRegistry is Ownable {
    // Arrays to store valid components for generating names
    string[] public validAdjectives;
    string[] public validDescriptors;
    string[] public validNouns;
    uint256[] public supportedChains;

    // Mapping from address to registered ID
    mapping(address => string) public addressToId;
    // Mapping from ID to address
    mapping(string => address) public idToAddress;

    event IdRegistered(address indexed user, string id);
    event ComponentsUpdated();

    constructor() Ownable() {
        // Transfer ownership to msg.sender
        _transferOwnership(msg.sender);
    }

    /**
     * @dev Set valid components for name generation
     * @param adjectives Array of valid adjectives
     * @param descriptors Array of valid descriptors
     * @param nouns Array of valid nouns
     * @param chains Array of supported chain IDs
     */
    function setValidComponents(
        string[] memory adjectives,
        string[] memory descriptors,
        string[] memory nouns,
        uint256[] memory chains
    ) external onlyOwner {
        delete validAdjectives;
        delete validDescriptors;
        delete validNouns;
        delete supportedChains;

        for (uint i = 0; i < adjectives.length; i++) {
            validAdjectives.push(adjectives[i]);
        }

        for (uint i = 0; i < descriptors.length; i++) {
            validDescriptors.push(descriptors[i]);
        }

        for (uint i = 0; i < nouns.length; i++) {
            validNouns.push(nouns[i]);
        }

        for (uint i = 0; i < chains.length; i++) {
            supportedChains.push(chains[i]);
        }

        emit ComponentsUpdated();
    }

    /**
     * @dev Register a new ID for an address
     * @param id The ID to register
     */
    function registerID(string calldata id) external {
        require(bytes(addressToId[msg.sender]).length == 0, "Address already has an ID");
        require(idToAddress[id] == address(0), "ID already registered");

        addressToId[msg.sender] = id;
        idToAddress[id] = msg.sender;

        emit IdRegistered(msg.sender, id);
    }

    /**
     * @dev Get the ID for an address
     * @param addr The address to query
     * @return The ID associated with the address
     */
    function getID(address addr) external view returns (string memory) {
        return addressToId[addr];
    }

    /**
     * @dev Get the address for an ID
     * @param id The ID to query
     * @return The address associated with the ID
     */
    function getAddress(string calldata id) external view returns (address) {
        return idToAddress[id];
    }

    /**
     * @dev Get all valid components for name generation
     * @return Arrays of valid adjectives, descriptors, nouns, and supported chains
     */
    function getAllComponents() external view returns (
        string[] memory, 
        string[] memory, 
        string[] memory, 
        uint256[] memory
    ) {
        return (validAdjectives, validDescriptors, validNouns, supportedChains);
    }
}

